import styled from 'styled-components'
import Image from 'next/image'

const HomeContainer = () => {

    return (
        <Container>
            <Img>
                <Image
                    src="/coding.png"
                    alt="Coding image"
                    layout="responsive"
                    height={500}
                    width={500}
                />
            </Img>
        </Container>
    )

}

const Container = styled.div`
    display: flex;
    flex-direction: column;
    
`
const Img = styled(Container)`
    display: flex;
    max-width: 500px;
    max-heigh: 500px;
`

export default HomeContainer
